import React from 'react';
import { Grid,Typography,Button, AppBar, Toolbar, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';
import {useNavigate} from 'react-router-dom';
import Charity from '../../images/charityHelp.jfif';


const StartButton = styled(Button)(({ theme }) => ({
  color: '#FFFFFF',
  backgroundColor: '#FFF345',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));

const Styledappbar = styled(AppBar)(({theme}) =>({
  backgroundColor:'#000000'
}));

export default function Home() {
  let navigate = useNavigate();

  let startButtonClick = ()=>{
    navigate('/login');
  }


  return (
    <div>
      <Styledappbar position='sticky' elevation={4}>
        <Toolbar>
          Eden's Garden
        </Toolbar>
      </Styledappbar>
      <Grid container columns={1}>
        <Grid item  sx={{  height: '25rem', width:'100%'}}>
        </Grid>
      </Grid>
    </div>
  );
}
